        /// <summary>
        /// Returns the daylight saving time period for a particular year.
        /// </summary>
        /// <param name="year">The year to which the daylight saving time period applies.</param>
        /// <returns>
        /// A <see cref="T:System.Globalization.DaylightTime"></see> instance containing the start and end date for daylight saving time in year.
        /// </returns>
        /// <exception cref="T:System.ArgumentOutOfRangeException">year is less than 1 or greater than 9999. </exception>
        public override DaylightTime GetDaylightChanges(int year)
        {
            if (year < 1 || year > 9999)
            {
                throw new ArgumentOutOfRangeException("year");
            }

            DaylightTime result = null;

            // First, figure out which zone we're in
            DateTime point = new DateTime(year, 1, 1);
            TzDatabase.TzZone targetZone = GetZone(ref point);

            if (targetZone != null)
            {
                // The zone might not have any daylight savings time rules
                if (targetZone.RuleName != TzDatabase.NotApplicableValue)
                {
                    // There's a rule to use for daylight savings time,
                    // so we need to figure out the begin and end of daylight
                    // savings time
                    TzDatabase.TzRule start, end;
                    GetChangeRules(targetZone.RuleName, point, out start, out end);
                    DateTime startDateTime = start.GetOnDateTime(point.Year);
                    DateTime endDateTime = end.GetOnDateTime(point.Year);
                }
            }

            return result;
        }

        private TzDatabase.TzZone GetZone(ref DateTime point)
        {
            TzDatabase.TzZone targetZone = null;
            foreach (TzDatabase.TzZone zone in Info.Zones)
            {
                if (!zone.IsGreaterThanUntil(point))
                {
                    targetZone = zone;
                    break;
                }
            }
            return targetZone;
        }

        private void GetChangeRules(string ruleName, DateTime point, out TzDatabase.TzRule start, out TzDatabase.TzRule end)
        {
            start = end = null;

            // We search over all rules, looking at only those rules with
            // the rule name that is passed in. The first rule that we find
            // which has a FromYear less than the point's year and a ToYear
            // grater than the point's year is the year of the rule we want to use
            foreach (TzDatabase.TzRule rule in Info.Rules)
            {
                if (rule.RuleName == ruleName)
                {
                    if (point.Year >= rule.FromYear &&
                        point.Year <= rule.ToYear)
                    {
                        if (start == null)
                        {
                            start = rule;
                        }
                        else if (end == null)
                        {
                            end = rule;
                        }
                        else
                        {
                            throw new TzDatabase.TzException("More than one rule for rule name " + ruleName + " matches " + point);
                        }
                    }
                }
            }

            // If they're both not null, then make sure we sort them
            if (start != null && end != null)
            {
            }
            else
            {
                Console.WriteLine("Either start or end are null for GetChangeRules " + ruleName);
            }
        }

        /// <summary>
        /// Returns the coordinated universal time (UTC) offset for the specified local time.
        /// </summary>
        /// <param name="time">The local date and time.</param>
        /// <returns>
        /// The UTC offset from time, measured in ticks.
        /// </returns>
        public override TimeSpan GetUtcOffset(DateTime time)
        {
            // This method is regardless of the type of the time,
            // whether it is local, UTC, specified, or other.
            /*switch (time.Kind)
            {
                case DateTimeKind.Utc:
                    return TimeSpan.Zero;
                case DateTimeKind.Unspecified:
                    if (!TreatUnspecifiedKindAsLocal)
                    {
                        throw new ArgumentException("unspecified type");
                    }
                    break;
            }*/

            // Figure out the offset for the local time
            TzDatabase.TzZone zone = GetZone(ref time);
            if (zone != null)
            {
                return zone.UtcOffset;
            }

            return TimeSpan.Zero;
        }

