        /// the same as finding a new zone.
        /// </summary>
        /// <value>The name of the zone.</value>
        public string ZoneName
        {
            get
            {
                return this.m_info.ZoneName;
            }
            set
            {
                if (string.IsNullOrEmpty(value))
                {
                    throw new ArgumentNullException("ZoneName");
                }
                TzZoneInfo zoneInfo;
                if (Zones.TryGetValue(value, out zoneInfo))
                {
                    m_info = zoneInfo;
                }
                else
                {
                    throw new TzDatabase.TzException("Invalid time zone " + value);
                }
            }
        }

        private DateTime ToUTC(ref DateTime time, bool addUtc)
        {
            TimeSpan utcOffset = GetUtcOffset(time);
            DateTime result = !addUtc ? time + utcOffset : time - utcOffset;
            return DateTimeUtlities.CloneDateTimeAsUTC(result);
        }

